import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import { ThemeProvider, CssBaseline, Box, AppBar, Toolbar, Typography, IconButton, Drawer, List, ListItemButton, ListItemText, Divider, TextField, Button } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import HomePage from './HomePage';
import CategoryPage from './CategoryPage';
import PhotoDetail from './PhotoDetail';
import theme from './theme';

function App() {
  const [mobileOpen, setMobileOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const navigate = useNavigate();

  const handleDrawerToggle = () => setMobileOpen(!mobileOpen);

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchTerm.trim()) {
      navigate(`/category/${searchTerm.trim()}`);
      setSearchTerm('');
      setMobileOpen(false);
    }
  };

  const drawerItems = [
    { text: 'Doğa', to: '/category/nature' },
    { text: 'Teknoloji', to: '/category/technology' },
    { text: 'Seyahat', to: '/category/travel' },
  ];

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static" sx={{ background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)' }}>
        <Toolbar>
          <Typography component={Link} to="/" variant="h5" sx={{ color: 'white', textDecoration: 'none', flexGrow: 1 }}>
            Fotoğraf Galerisi
          </Typography>
          <Box component="form" onSubmit={handleSearch} sx={{ display: { xs: 'none', md: 'flex' }, gap: 1 }}>
            <TextField
              size="small"
              placeholder="Kategori ara..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              sx={{ backgroundColor: 'rgba(255,255,255,0.15)', borderRadius: 1 }}
            />
            <Button type="submit" variant="contained">Ara</Button>
          </Box>
          <IconButton color="inherit" edge="end" onClick={handleDrawerToggle} sx={{ display: { md: 'none' } }}>
            <MenuIcon />
          </IconButton>
        </Toolbar>
      </AppBar>

      <Drawer
        open={mobileOpen}
        onClose={handleDrawerToggle}
        sx={{ '& .MuiDrawer-paper': { width: 250 } }}
      >
        <List>
          {drawerItems.map((item) => (
            <ListItemButton key={item.text} component={Link} to={item.to} onClick={() => setMobileOpen(false)}>
              <ListItemText primary={item.text} />
            </ListItemButton>
          ))}
        </List>
        <Divider />
        <Box component="form" onSubmit={handleSearch} sx={{ p: 2 }}>
          <TextField
            size="small"
            placeholder="Kategori ara..."
            fullWidth
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <Button type="submit" variant="contained" fullWidth sx={{ mt: 1 }}>Ara</Button>
        </Box>
      </Drawer>

      <Box sx={{ minHeight: 'calc(100vh - 64px)', p: { xs: 2, md: 4 }, backgroundColor: theme.palette.background.default }}>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/category/:category" element={<CategoryPage />} />
          <Route path="/photo/:id" element={<PhotoDetail />} />
        </Routes>
      </Box>
    </ThemeProvider>
  );
}

export default App;
